import { ADD_PROFESSIONAL_DATA } from '../actions';

const INITIAL_STATE = {
  curriculum: '',
  job: '',
  description: '',
};

const professionalData = (state = INITIAL_STATE, action) => {
  console.log(action);
  switch (action.type) {
  case ADD_PROFESSIONAL_DATA:
    return {
      ...state,
      address: action.address,
      city: action.city,
      cpf: action.cpf,
      email: action.email,
      name: action.name,
      uf: action.uf,
    };
  default:
    return {
      ...state,
    };
  }
};

export default professionalData;
